var pageGap = 10;
export function createHeader(doc) {
    let imgData = "data:image/png;base64,";
    doc.setFontSize(14);
    doc.text(pageGap, pageGap + 12, "Openstack VM Usage Report");
    doc.addImage(imgData, 'PNG', 150, pageGap + 5, 10, 10);
    doc.text(162, pageGap + 12, 'Cloudbolt');
    doc.setFontSize(12);
    doc.line(pageGap, pageGap + 18, 200, pageGap + 18); // horizontal line.
    doc.setLineWidth(0.5);
}


export function createFooter(doc) {
    let pageCount = doc.internal.getNumberOfPages();
    doc.setFont("courier");
    doc.setFontType("normal");
    doc.setFontSize(9)
    for (let i = 1; i <= pageCount; i++) {
        doc.setPage(i);
        doc.text(83, 294, "Powered by Cloudbolt");
    }
}
